window.bookSummaryJSON = "Come with us to an Enchanted Place, a forest where Winnie-the-Pooh lived with Piglet, Rabbit, Owl, Eeyore, Kanga, and Little Roo. The stories are about Christopher Robin and these good companions having wonderful times getting in and out of trouble. It is all very exciting and, really, quite thrilling no matter how young or old you may be. It is painful to try and imagine what the world would be like without them. <p>Blackstone Audiobooks presents, from the unabridged collection <i>A.A. Milne's Pooh Classics</i>, the 10 stories of <i>Winnie-the-Pooh</i> performed by Peter Dennis. This is the only reading of these immortal stories authorized by A.A. Milne's son, Christopher Robin, who wrote, \"Peter Dennis has made himself Pooh's Ambassador Extraordinare and no bear has ever had a more devoted friend. So if you want to meet the real Pooh, the bear I knew, the bear my father wrote about, listen to Peter.\"</p> <p>This collection includes the chapters:<br><i>In Which</i> We Are Introduced to Winnie-the-Pooh and Some Bees, and the Stories Begin<br><i>In Which</i> Pooh Goes Visiting and Gets Into a Tight Place<br><i>In Which</i> Pooh and Piglet Go Hunting and Nearly Catch a Woozle<br><i>In Which</i> Eeyore Loses a Tail and Pooh Finds One<br><i>In Which</i> Piglet Meets a Heffalump<br><i>In Which</i> Eeyore Has a Birthday and Gets Two Presents<br><i>In Which</i> Kanga and Baby Roo Come to the Forest, and Piglet Has a Bath<br><i>In Which</i> Christopher Robin Leads an Expotition to the North Pole<br><i>In Which</i> Piglet is Entirely Surrounded by Water<br><i>In Which</i> Christopher Robin Gives a Pooh Party, and We Say Goodbye</p>"; 
